import React, { Component } from "react";
import { NavLink } from "react-router-dom";
import logo from "../assets/images/logo-white.png";
import { useMediaQuery } from "react-responsive";
console.log(logo);

const Desktop = ({ children }) => {
  const isDesktop = useMediaQuery({ minWidth: 992 });
  return isDesktop ? children : null;
};

class Navigation extends Component {
  render() {
    return (
      <div>
        <Desktop className="navigation">
          <NavLink exact="true" to="/" className="nav-home">
            Home
          </NavLink>
          <NavLink exact="true" to="/a-propos" className="nav-about">
            A propos
          </NavLink>
          <img src={logo} alt="Logo" />
          <NavLink exact="true" to="/atelier" className="nav-workshop">
            Mon atelier
          </NavLink>
          <NavLink exact="true" to="/contact" className="nav-contact">
            contact
          </NavLink>
        </Desktop>
      </div>
    );
  }
}

export default Navigation;
